script:
const size = { x: 14, y: 12, z: 48 };
const origin = { x: -7, y: 1, z: -22 };

reset();

// outside
box(
  origin.x - 2, origin.y - 1, origin.z - 2,
  size.x + 4, 12 + 2, size.z + 4,      
  1
);
box(
  origin.x - 2, origin.y + size.y + 1, origin.z - 2,
  size.x + 4, 1, size.z + 4,      
  4
);

// front/back windows
box(
  origin.x + 1, origin.y + 4, origin.z - 2,
  size.x - 2, size.y - 6, size.z + 4,      
  3
);
box(
  origin.x + 5, origin.y + 3, origin.z - 2,
  4, 1, size.z + 4,      
  3
);

// side windows
for (let i = 0; i < 6; i += 1) {
  box(
    origin.x - 2, origin.y + 4, origin.z + i * 8 + 1,
    size.x + 4, 6, 6,      
    3
  );
}

// inside
box(
  origin.x, origin.y, origin.z,
  size.x, size.y, size.z,      
  0
);

// bars
for (let i = 0; i < 2; i += 1) {
  box(
    origin.x + (i === 0 ? 0 : size.x - 1), origin.y + size.y - 1, origin.z,
    1, 1, size.z,
    1
  );
  box(
    origin.x + (i === 0 ? 0 : size.x - 1), origin.y, origin.z,
    1, 1, size.z,
    1
  );
}

// door
box(
  origin.x + size.x, origin.y, origin.z + 1,
  2, size.y, 7,
  1
);
box(
  origin.x + size.x - 1, origin.y, origin.z + 1,
  3, size.y - 2, 5,      
  0
);
box(
  origin.x + size.x + 1, origin.y, origin.z + 1,
  1, size.y - 2, 5,      
  0
);


// door
if (false) {
  box(
    origin.x + size.x + 1, origin.y, origin.z + 2,
    1, size.y - 2, 3,      
    5
  );
  box(
    origin.x + size.x + 1, origin.y + 1, origin.z + 3,
    1, size.y - 4, 1,      
    6
  );
}

// Map
box(
  origin.x + size.x, origin.y + 4, origin.z + 25,
  1, 6, 6,
  0
);


// top lights
for (let i = 0; i < 2; i += 1) {
  box(
    origin.x + (i === 0 ? 1 : size.x - 2), origin.y + size.y - 1, origin.z,
    1, 1, size.z,
    (x, y, z) => {
      if (Math.floor((z - 4) / 3) % 2 === 0) {
        return 2;
        //update(x + (i === 0 ? 1 : -1), y, z, 2);
      }
      return 1;
    }
  );
}

// Seats
for (let i = 0; i < 2; i += 1) {
  for (let j = 0; j < 3; j += 1) {
    const x = origin.x + size.x * 0.5;
    const z = origin.z + (
      i === 0 ? (10 + j * 6) : (size.z - 3 - j * 6)
    );
    box(
      x, origin.y, z,
      6, 4, 1,
      7
    );
    box(
      x, origin.y + 1, z + (i === 0 ? 1 : -2),
      6, 1, 2,
      7
    );
        box(
      x - 7, origin.y + 1, z + (i === 0 ? 1 : -4),
      1, 10, 1,
      8
    );
  }
}
return;
// ref dude
box(
  origin.x + 1, origin.y, origin.z + 6,
  1 * 4, 2 * 4, 1 * 4,
  3
);
